import React from 'react';
import './style.css';

function Signup() {
    return (
    	<div className='linkBody'>
    		<div className='titleContainer'>
            	<h1 className='pageTitle'>Welcome to the sign up page</h1>
        	</div>
        </div>
    );
}

export default Signup;
